import React, { Component } from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import { SocialIcon } from 'react-social-icons';
import './navbar.scss';
import logo from "./assets/logo.svg";

export default class Navbar extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
    };
    style_icons = "{{ position: 'inherit', left: -5, height: 35, width: 35 }}";
  render() {
    return (
      <nav className="nav" id="navbar">
        <div className="nav-content">
          <img
            src={logo}
            className="nav-logo"
            alt="Logo"
            onClick={this.scrollToTop}
          />
          <ul className="nav-items">
            <li className="nav-item" onClick={this.scrollToTop} >Section 1</li>
            <li className="nav-item">Section 2</li>
            <li className="nav-item">Section 3</li>
            <li className="nav-item">Section 4</li>
            <li className="nav-item">Section 5</li>
          </ul>
          <Link
            activeClass="active"
            to="section1"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          ></Link>

          <div className="networks">
            <SocialIcon 
            url="https://www.facebook.com/loic.verhaeghe.56/"
            style={{ position: 'absolute', left: 0, height: 45, width: 45 }}
            target="_blank"/>
            <SocialIcon 
            url="https://www.linkedin.com/in/lo%C3%AFc-verhaeghe-429410190/"
            style={{ position: 'absolute', left: 25, height: 45, width: 45 }} 
            target="_blank"/>
            <SocialIcon
            url="https://www.instagram.com/caderonas/"
            style={{ position: 'absolute', left: 50, height: 45, width: 45 }} 
            target="_blank"/>
            <SocialIcon
            url="https://dribbble.com/Caderonas" 
            style={{ position: 'absolute', left: 75, height: 45, width: 45 }}
            target="_blank"/>
          </div>
        </div>
      </nav>
    );
  }
}
